  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:02.822606\",\n\t\"name\": \"a-water-bird-survey-in-bristol-bay-and-proposals-for-future-studies\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This paper reports a preliminary attempt
  to census fall water bird populations in Bristol Bay within the zone from high tide
  to the 12-mile off shore limit. Aerial sampling techniques, originally designed
  for censusing breeding pairs of ducks in marshlands, were modified slightly for
  this survey. Results of our census provided positive information on these bird populations
  and indicated that, with further refinements, better information can be collected
  in the future.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
